About Game:
Discover the world of light physics: play with lasers, prisms, mirrors, magnets and dozens of other optical devices. Explore the world of Optika with Prof. Opticus and his assistant, Sofia! Research and complete more than one hundred challenging puzzles! All of the puzzles you are about to experience are inspired by real world physics!

